const toolbar = {
  avatar: "./images/avatar/avatar.jpg",
  items: [
    { title: "About", links: "#about" },
    { title: "Timeline", links: "#timeline" },
    { title: "Projects", links: "#projects" }
  ]
};

export default toolbar;
